import Expenses from "./components/Expenses";
import newExpense from "./components/NewEx";
function App() {
  const expenses = [
    {
      id: 1,
      date: new Date(2021, 7, 14),
      title: "Kitchen Tools",
      amount: 70,
    },
    {
      id: 2,
      date: new Date(2021, 9, 14),
      title: "room Tools",
      amount: 100,
    },
    {
      id: 1,
      date: new Date(2019, 6, 14),
      title: "gymTools",
      amount: 170,
    },
    {
      id: 1,
      date: new Date(2018, 8, 14),
      title: "makeup Tools",
      amount: 190,
    },
  ];

  return (
    <div>
      <Expenses items={expenses} />
    </div>
  );
}

export default App;
